import React from 'react'
import namedb from './names'



const showListofNames = (props) => {
    //this component gets the table in wanted order as props
    return(
        <ul>
            {props.map(n => (
                <li key={n.name}>
                    {n.name} {n.amount}
                </li>
            ))}
        </ul>
    )
}

const App = () => {  
  return (
    <div>
        {showListofNames(namedb.names)}
    </div>
  )
}

export default App
